from unicodedata import name
import discord
from discord.ext import commands
import json
import math




class pi(commands.Cog, name="ranking"):

    def __init__(self, client):
        self.client = client

    @commands.Cog.listener()
    async def on_message(self, message):
        if "pi" in message.content or "파이값" in message.content or "PI" in message.content or "Pi" in message.content or "∏" in message.content or "π" in message.content:
            await message.channel.send("3.")
            await message.channel.send("")
def setup(client):
    client.add_cog(pi(client))
